import SettingsIcon from './icons/SettingsIcon';
import ProfileIcon from './icons/ProfileIcon';
const Sidebar = () => {
    return (
      <div className="w-64 bg-gray-100 flex flex-col">
        <div className="p-4">
          <h1 className="text-xl font-bold">Delphi Demo</h1>
        </div>

        <nav className="flex-1 p-4">
          <ul className="space-y-4">
            <li>
              <a href="#" className="block py-2 px-4 rounded-2xl bg-gray-200 hover:bg-gray-600">
                <SettingsIcon size={24} strokeWidth={1.5} />
              </a>
            </li>
            <li>
              <a href="#" className="block py-2 px-4 rounded-2xl  bg-gray-200 hover:bg-gray-600">
                <ProfileIcon size={24} strokeWidth={1.5} />
              </a>
            </li>
          </ul>
        </nav>

        <div className="p-4 bg-gray-100">
          <p className="text-xs">&copy; 2024 Delphi.</p>
        </div>
      </div>
    );
  };

  export default Sidebar;
